import React from "react";
import './options.css'

const Buttons=()=>{
    return(
        <div className="nav-buttons">
            <div className="top-buttons">
                <button className="opt"><a></a>Platform</button>
                <button className="opt">Scenarios</button>
                <button className="opt">Demo</button>
            </div>
            <div className="bottom-buttons">
                <button className="opt">Features</button>
                <button className="opt">Pricing</button>
                <button className="opt">Start Over</button>
            </div>
        </div>
    )
}

export default Buttons;
